/**
 * Initial thoughts:
 *      Use a set to store string s and go through t using set look up
 *          if not present, return letter
 * 
 * 
 */

/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 */

// Dumb solution becuase s can have a string with repeated letters. Then identifying based on count does not work
let findTheDifference = function (s,t){

    // String s to set
    // Map() can take an iterable
    // O(n) cause it has to insert each element to set which is O(1) average
    // Unless a hashing collision reduces it to O(n) worst case

    // [...s] is list comprehension
    // map funciton sets each value -> value to count
    let myMap = new Map([...s].map(char => [char,0]));

    for (char of t){
        // if not is set, then new
        if (!myMap.has(char)){
            return char;
        }
        
        console.log([...myMap.values()]);
        // If inside, increase count
        if(myMap.has(char)){
            // Add count
            myMap.set(char,myMap.get(char) + 1);
            
            // If count === 2, return char becuase it is additi0nal
            if (myMap.get(char) === 2){
                return char;
            }
        }
    }
}

// console.log(findTheDifference('',''));


/**
 * 
 * @param {number} s 
 * @param {number} t 
 */
let findTheDifference_2 = function(s,t){
    // maps : char -> count
    let s_map = new Map();
    let t_map = new Map();

    // if char in map, count++, else add to map count = 1
    for (char of s){

        if (s_map.has(char)){
    
            s_map.set(char, s_map.get(char) + 1);
        }
        // Add to map with count 1
        else{
            s_map.set(char, 1);
        }
    }
    // if char in map, count++ , esle add to map
    // 
    for (char of t){

        if(!s_map.has(char)){
            return char;
        }

        if(t_map.has(char)){
            t_map.set(char, t_map.get(char) + 1);
        }

        else{
            t_map.set(char, 1);
        }

        // if char in t occurs more than it does in s
        if(t_map.get(char) > s_map.get(char)){
            return char;
        }
    }
    return null;
}


console.log(findTheDifference_2('',''));